import itertools
from math import log2

def transform(i, n):
    #return i ^ (2**n - 1)
    b = bin(2**n - 1 - i)[2:]
    return int(('0'*(n - len(b)) + b)[::-1], 2)

def mb(i, n):
    b = bin(i)[2:]
    return '0'*(n - len(b)) + b

